import React from 'react';
import FoundNums from '../components/FoundNums';
import SelectBox from '../components/SelectBox';
const FonudContainer=()=>(
     <div style={{width:'1000px',display:'flex',flexWrap:'wrap'}}>
    <div style={{width:'1000px',display:'flex',justifyContent:'space-between'}}>
     <FoundNums foundNums={0}/>
     <SelectBox/>
     </div>
     </div>
     )



 export default FonudContainer;
